const targetNode = document.querySelector('#index-box > div');
const targetNodePc = document.querySelector('#form');

/* 观察器的配置（需要观察什么变动）*/
const config = {attributes: true, childList: true, subtree: true};
var arr = [];

/* 当观察到变动时执行的回调函数*/
const callback = function () {
    pc();
}

function mobile() {
    document.querySelector('#index-box > div > div.suggest-panel').querySelectorAll('.sug')
        .forEach(item => {
            console.log(item.innerText);
            if (arr.indexOf(item.innerText) < 0) {
                arr.push(item.innerText);
            }
        })
}
function pc() {
    let ul = document.querySelector('#normalSugSearchUl');
    console.log(ul);
    if (ul) {
        let lis = ul.querySelectorAll('li');
        console.log(lis);
        if (lis && lis.length > 0) {
            lis.forEach(item => {
                console.log(item.innerText);
                if (arr.indexOf(item.innerText) < 0) {
                    arr.push(item.innerText);
                }
            })
        }
    }
}


/* 创建一个观察器实例并传入回调函数*/
const observer = new MutationObserver(callback);

// 以上述配置开始观察目标节点
observer.observe(targetNodePc, config);

function copyStringToClipboard(str) {
    var el = document.createElement("textarea");
    el.value = str;
    el.setAttribute("readonly", "");
    el.style = {position: "absolute", left: "-9999px"};
    document.body.appendChild(el);
    el.select();
    document.execCommand("copy");
    document.body.removeChild(el);
}

copyStringToClipboard(JSON.stringify(arr));

